.profile {
    .content {
        max-width: 600px;
        margin: 0 auto;
        img {
            border-radius: 50%;
            cursor: pointer;
        }
        .group-img {
            position: relative;
            margin-bottom: 20px;
            text-align: center;
            input {
                opacity: 0;
                height: 160px;
                width: 160px;
                position: absolute;
                z-index: 1;
                margin-left: -160px;
            }
        }
        .btn-ghost-danger {
            margin-left: 20px;
        }
    }
}
.profile-content {
    .modal-body {
        display: none;
    }
    .modal-footer {
        .btn-secondary {
            display: none;
        }
    }
}
